    "Investigation of oil drilling impacts to aquatic habitat resources: In Situ biological
    assessment of the photoinduced toxicity of environmental releases of crude oil",nt"tracking_summary":
    {ntt"total": 13,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:07.836821",nt"name": "investigation-of-oil-drilling-impacts-to-aquatic-habitat-resources-in-situ-biological-asse",nt"isopen":
    false,nt"url": null,nt"notes": "This study proposed a biological assessment
    of a recent crude oil spill for potential impacts to aquatic resources due to petroleum
    hydrocarbon wastes. The objectives of the proposed study were to assess the phototoxicity
    of crude oil releases to the environment (specifically the polycyclic aromatic hydrocarbon
    fraction) in situ; and to compare the in situ phototoxic response to identical tests
    conducted under controlled laboratory conditions. Following acute exposure periods,
    Lumbriculus variegatus mortality under natural sunlight at a crude oil contaminated
    site was significantly higher than corresponding mortality protected from UV radiation.
    L. variegatus experienced greater than 90% mortality in a crude oil contaminated
    wetland during exposure to sunlight, 0% mortality at reference sites, and less than
    40% mortality across corresponding treatments protected from UV radiation. Pimephales
    promelas mortality exposed to sunlight in crude oil contaminated wetlands was not
    significantly different from corresponding treatments protected from UV radiation.
    Results indicate that crude oil contaminated sediments in the aquatic environment
    have the potential to substantially adversely affect survival of UV-exposed aquatic
    organisms.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
